import BetList from "../bets/BetList";
import { useState, useEffect } from "react";
import axios from "axios";

function MyBets(props) {
  const [isLoading, setIsLoading] = useState(false);
  const [loadedBets, setLoadedBets] = useState([]);

  const [user, setUser] = useState(null);

  console.log(props.user);
  console.log("USER ID ", props.user.id);
  console.log("DZET SET ", props.user.bet_set);

  //   useEffect(() => {
  //     setIsLoading(true);

  //     axios({
  //       method: "get",
  //       url: "api/bets/user?userId=" + props.user.id,
  //     }).then((response) => {
  //       let bets = response.data;
  //       let ret = [];
  //       console.log("Bets", bets);
  //       for (let i in bets) {
  //         ret.push(bets[i]);
  //       }
  //       console.log("RET", ret);
  //       setIsLoading(false);
  //       setLoadedBets(ret);
  //     });
  //   }, []); //ako se drugom argumentu promeni stanje onda se opet pozove funkcija

  useEffect(() => {
    (async () => {
      const response = await fetch("http://127.0.0.1:8000/api/user", {
        headers: { "Content-Type": "application/json" },
        credentials: "include",
      });

      const content = await response.json();
      console.log("IDE CONTENT", content);
      setUser(content);
      axios({
        method: "get",
        url: "api/bets/user?userId=" + content.id,
      }).then((response) => {
        console.log("DJE STE VI BRE", response.data);
        let bets = response.data;
        let ret = [];
        console.log("Bets", bets);
        for (let i in bets) {
            if(bets[i].success === "upcoming") {
                console.log(i, "ceka se jos")
            } else if(bets[i].success === "success") {
                console.log("kasirao ga");
            } else if(bets[i].sucess === "failure") {
                console.log("bezis od kase");
            }
            ret.push(bets[i]);
        }
        console.log("RET", ret);
        setIsLoading(false);
        setLoadedBets(ret);
      });
    })();
  }, []);

  useEffect(() => {}, []);

  console.log("to je moj user ", user);

  if (isLoading) {
    return (
      <section>
        <p>Loading...</p>
      </section>
    );
  }

  return (
    <div>
      <h1>My bets</h1>
      <BetList bets={loadedBets} />
    </div>
  );
}

export default MyBets;
